ery+allusers-paramvalue-prop-rights','s:31:\"Lists rights that the user has.\";'),('en','messages:apihelp-query+allusers-summary','s:31:\"Enumerate all registered users.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login','s:59:\"Fetch the requests that may be used when beginning a login.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login-merged','s:84:\"Fetch the requests that may be used when beginning a login, with form fields merged.\";'),('en','messages:apihelp-query+authmanagerinfo-example-securitysensitiveoperation','s:68:\"Test whether authentication is sufficient for action <kbd>foo</kbd>.\";'),('en','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:99:\"Fetch information about the authentication requests needed for the specified authentication action.\";'),('en','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:115:\"Test whether the user\'s current authentication status is sufficient for the specified security-sensitive operation.\";'),('en','messages:apihelp-query+authmanagerinfo-summary','s:61:\"Retrieve information about the current authentication status.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:60:\"Get information about pages linking to <kbd>Main page</kbd>.\";'),('en','messages:apihelp-query+backlinks-example-simple','s:35:\"Show links to <kbd>Main page</kbd>.\";'),('en','messages:apihelp-query+backlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:143:\"How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-para