am-user','s:17:\"User being reset.\";'),('en','messages:apihelp-resetpassword-summary','s:38:\"Send a password reset email to a user.\";'),('en','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('en','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('en','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-tags','s:47:\"Tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-summary','s:30:\"Delete and undelete revisions.\";'),('en','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-extended-description','s:96:\"If the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-tags','s:30:\"Tags to apply to the rollback.\";'),('en','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-rollback-summary','s:31:\"Undo the last edit to the page.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-rsd-summary','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-extended-description','s:168:\"This affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\"