etpagelanguage-summary','s:30:\"Change the language of a page.\";'),('en','messages:apihelp-stashedit-extended-description','s:100:\"This is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-stashedit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-stashedit-param-stashedtexthash','s:52:\"Page content hash from a prior stash to use instead.\";'),('en','messages:apihelp-stashedit-param-summary','s:15:\"Change summary.\";'),('en','messages:apihelp-stashedit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-stashedit-param-title','s:31:\"Title of the page being edited.\";'),('en','messages:apihelp-stashedit-summary','s:32:\"Prepare an edit in shared cache.\";'),('en','messages:apihelp-summary','s:0:\"\";'),('en','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tag-example-rev','s:79:\"Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-tags','s:79:\"Tags to apply to the log entry that will be created as a result of this action.\";'),('en','messages:apihelp-tag-summary','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-tokens-example-edit','s:37:\"Retrieve an edit token (the default).\";'),('en','messages:apihelp-tokens-example-emailmove','s:41:\"Retrieve an email token and a move token.\";'),('en','messages:apihelp-tokens-extended-description','s:96:\"This module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('en','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('en','messages:apihelp-tokens-summary','s:38:\"Get tokens for data-modifying actions.\";'),('en','messages:apihelp-unblock-example-id','s:33:\"Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-unblock-param-id','s:140:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var> or <var>$1userid</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:19:\"Reason for unblock.\";'),('en','messages:apihelp-unblock-param-tags','s:51:\"Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-unblock-param-user','s:121:\"Username, IP address or IP address range to unblock. Cannot be used together with <var>$1id</var> or <var>$1userid</var>.\";'),('en','messages:apihelp-unblock-param-userid','s:86:\"User ID to unblock. Cannot be used together with <var>$1id</var> or <var>$1user</var>.\";'),('en','messages:apihelp-unblock-summary','s:15:\"Unblock a user.\";'),('en','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-extended-description','s:253:\"A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-reason','s:21:\"Reason for restoring.\";'),('en','messages:apihelp-undelete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('en','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-undelete-summary','s:36:\"Restore revisions of a deleted page.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:111:\"Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-unlinkaccount-summary','s:58:\"Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-extended-description','s:547:\"Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-summary','s:52:\"Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:72:\"Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:115:\"Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:360:\"Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:57:\"Change tags to apply to the entry in the user rights log.\";'),('en','messag