p sidan [[:$1|$1]]. Ngon annan har redan rullat tillbaka eller redigerat sidan.\n\nSidan ndrades senast av [[User:$3|$3]] ([[User talk:$3|diskussion]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]).\";'),('sv','messages:ancientpages','s:15:\"ldsta sidorna\";'),('sv','messages:ancientpages-summary','s:0:\"\";'),('sv','messages:and','s:8:\"&#32;och\";'),('sv','messages:anoncontribs','s:6:\"Bidrag\";'),('sv','messages:anoneditwarning','s:301:\"<strong>Varning:</strong> Du r inte inloggad. Din IP-adress kommer att vara publikt synlig om du gr ngra redigeringar. Om du <strong>[$1 loggar in]</strong> eller <strong>[$2 skapar ett konto]</strong> kommer dina redigeringar att tillskrivas ditt anvndarnamn, tillsammans med andra frdelar.\";'),('sv','messages:anonnotice','s:1:\"-\";'),('sv','messages:anononlyblock','s:17:\"endast oinloggade\";'),('sv','messages:anonpreviewwarning','s:108:\"\'\'Du r inte inloggad. Om du sparar kommer din IP-adress registreras p denna sidas redigeringshistorik.\'\'\";'),('sv','messages:anontalk','s:10:\"Diskussion\";'),('sv','messages:anontalkpagetext','s:519:\"----<em>Detta r diskussionssidan fr en anonym anvndare som inte nnu skapat ett konto, eller som inte anvnder det.</em>\nDrfr mste vi anvnda den numeriska IP-adressen fr att identifiera anvndaren.\nEn sdan IP-adress kan delas av flera anvndare.\nOm du r en anonym anvndare och knner att irrelevanta kommentarer har riktats mot dig, vnligen [[Special:CreateAccount|skapa ett konto]] eller [[Special:UserLogin|logga in]] fr att undvika framtida frvxlingar med andra anonyma anvndare.\";'),('sv','messages:anonuser','s:33:\"{{SITENAME}} anonym anvndare $1\";'),('sv','messages:anonusers','s:55:\"{{SITENAME}} {{PLURAL:$2|anonym|anonyma}} anvndare $1\";'),('sv','messages:anonymous','s:67:\"{{PLURAL:$1|Anonym anvndare|Anonyma anvndare}} p {{SITENAME}}\";'),('sv','messages:api-credits','s:370:\"API developers:\n* Yuri Astrakhan (creator, lead developer Sep 2006Sep 2007)\n* Roan Kattouw (lead developer Sep 20072009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (lead developer 2013present)\n\nPlease send your comments, suggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),('sv','messages:api-credits-header','s:7:\"Credits\";'),('sv','messages:api-error-badtoken','s:29:\"Internt fel: felaktig nyckel.\";'),('sv','messages:api-error-emptypage','s:50:\"Det r inte tilltet att skapa nya, tomma sidor.\";'),('sv','messages:api-error-publishfailed','s:56:\"Internt fel: Servern kunde inte publicera temporr fil.\";'),('sv','messages:api-error-stashfailed','s:52:\"Internt fel: servern kunde inte lagra temporr fil.\";'),('sv','messages:api-error-unknown-warning','s:21:\"Oknd varning: \"$1\".\";'),('sv','messages:api-error-unknownerror','s:17:\"Oknt fel: \"$1\".\";'),('sv','messages:api-exception-trace','s:15:\"$1 at $2($3)\n$4\";'),('sv','messages:api-feed-error-title','s:8:\"Fel ($1)\";'),('sv','messages:api-format-prettyprint-header','s:391:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('sv','messages:api-format-prettyprint-header-hyperlinked','s:377:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('sv','messages:api-format-prettyprint-header-only-html','s:219:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('sv','messages:api-format-prettyprint-status','s:55:\"This response would be returned with HTTP status $1 $2.\";'),('sv','messages:api-format-title','s:20:\"MediaWiki API result\";'),('sv','messages:api-help-authmanager-general-usage','s:1251:\"The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('sv','messages:api-help-authmanagerhelper-additional-params','s:341:\"This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('sv','messages:api-help-authmanagerhelper-continue','s:149:\"This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('sv','messages:api-help-authmanagerhelper-mergerequestfields','s:71:\"Merge field information for all authentication requests into one array.\";'),('sv','messages:api-help-authmanagerhelper-messageformat','s:37:\"Format to use for returning messages.\";'),('sv','messages:api-help-authmanagerhelper-preservestate','s:65:\"Preserve state from a previous failed login attempt, if possible.\";'),('sv','messages:api-help-authmanagerhelper-request','s:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('sv','messages:api-help-authmanagerhelper-requests','s:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('sv','messages:api-help-authmanagerhelper-returnurl','s:514:\"Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('sv','messages:api-help-datatypes','s:1234:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nSome parameter types in API requests need further explanation:\n;boolean\n:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\n;timestamp\n:Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\n;alternative multiple-value separator\n:Parameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\";'),('sv','messages:api-help-datatypes-header','s:10:\"Data types\";'),('sv','messages:api-help-examples','s:31:\"{{PLURAL:$1|Example|Examples}}:\";'),('sv','messages:api-help-flag-deprecated','s:28:\"Denna modul r frldrad.\";'),('sv','messages:api-help-flag-generator','s:43:\"Denna modul kan anvndas som en generator.\";'),('sv','messages:api-help-flag-internal','s:111:\"<strong>Denna modul r intern eller instabil.</strong> Dess funktion kan ndras utan fregende meddelande.\";'),('sv','messages:api-help-flag-mustbeposted','s:47:\"Denna modul accepterar endast POST-begranden.\";'),('sv','messages:api-help-flag-readrights','s:37:\"Denna modul krver lsrttigheter.\";'),('sv','messages:api-help-flag-writerights','s:38:\"Denna modul krver skrivrttigheter.\";'),('sv','messages:api-help-flags'