er-mode','s:226:\"<strong>Note:</strong> Due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]], using this may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('sv','messages:api-help-param-list','s:145:\"{{PLURAL:$1|1=Ett av fljande vrden|2=Vrden (separerade med <kbd>{{!}}</kbd> eller [[Special:ApiHelp/main#main/datatypes|alternativ]])}}: $2\";'),('sv','messages:api-help-param-list-can-be-empty','s:54:\"{{PLURAL:$1|0=Mste vara tom|Kan vara tom, eller $2}}\";'),('sv','messages:api-help-param-maxbytes','s:48:\"Kan inte vara lngre n $1 {{PLURAL:$1|byte}}.\";'),('sv','messages:api-help-param-maxchars','s:50:\"Kan inte vara lngre n $1 {{PLURAL:$1|tecken}}.\";'),('sv','messages:api-help-param-multi-all','s:41:\"To specify all values, use <kbd>$1</kbd>.\";'),('sv','messages:api-help-param-multi-max','s:73:\"Maximum number of values is {{PLURAL:$1|$1}} ({{PLURAL:$2|$2}} for bots).\";'),('sv','messages:api-help-param-multi-max-simple','s:45:\"Maximum number of values is {{PLURAL:$1|$1}}.\";'),('sv','messages:api-help-param-multi-separate','s:91:\"Separera vrden med <kbd>|</kbd> eller [[Special:ApiHelp/main#main/datatypes|alternativ]].\";'),('sv','messages:api-help-param-no-description','s:51:\"<span class=\"apihelp-empty\">(no description)</span>\";'),('sv','messages:api-help-param-required','s:33:\"Denna parameter r obligatorisk.\";'),('sv','messages:api-help-param-templated','s:105:\"This is a [[Special:ApiHelp/main#main/templatedparams|templated parameter]]. When making the request, $2.\";'),('sv','messages:api-help-param-templated-var','s:54:\"<var>&#x7B;$1&#x7D;</var> with values of <var>$2</var>\";'),('sv','messages:api-help-param-templated-var-first','s:97:\"<var>&#x7B;$1&#x7D;</var> in the parameter\'s name should be replaced with values of <var>$2</var>\";'),('sv','messages:api-help-param-token','s:85:\"A \"$1\" token retrieved from [[Special:ApiHelp/query+tokens|action=query