pihelp-login-param-domain','s:18:\"Domn (valfritt).\";'),('sv','messages:apihelp-login-param-name','s:14:\"Anvndarnamn.\";'),('sv','messages:apihelp-login-param-password','s:10:\"Lsenord.\";'),('sv','messages:apihelp-login-param-token','s:42:\"Login nyckel erhllen i frsta begran.\";'),('sv','messages:apihelp-login-summary','s:40:\"Logga in och hmta autentiseringskakor.\";'),('sv','messages:apihelp-logout-example-logout','s:33:\"Logga ut den aktuella anvndaren\";'),('sv','messages:apihelp-logout-summary','s:32:\"Logga ut och rensa sessionsdata.\";'),('sv','messages:apihelp-main-extended-description','s:1181:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Dokumentation]]\n* [[mw:Special:MyLanguage/API:FAQ|Vanliga frgor]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Sndlista]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API-nyheter]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Buggar och begran]\n</div>\n<strong>Status:</strong> Alla funktioner som visas p denna sida br fungera, men API:et r fortfarande under utveckling och kan ndras nr som helst. Prenumerera p [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ sndlistan mediawiki-api-announce] fr uppdateringsaviseringar.\n\n<strong>Felaktiga begran:</strong> Nr felaktiga begran skickas till API:et kommer en HTTP-header skickas med nyckeln \"MediaWiki-API-Error\" och sedan kommer bde vrdet i headern och felkoden som skickades tillbaka anges som samma vrde. Fr mer information se [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Fel och varningar]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testning:</strong> Fr enkelt testning av API-begran, se [[Special:ApiSandbox]].</p>\";'),('sv','messages:apihelp-main-param-action','s:33:\"Vilken tgrd som ska utfras.\";'),('sv','messages:apihelp-main-param-assert','s:133:\"Bekrfta att anvndaren r inloggad om satt till <kbd>user</kbd>, eller har bot-anvndarrttigheter om satt till <kbd>bot</kbd>.\";'),('sv','messages:apihelp-main-param-assertuser','s:70:\"Verifiera att den nuvarande anvndaren r den namngivne anvndaren.\";'),('sv','messages:apihelp-main-param-curtimestamp','s:50:\"Inkludera den aktuella tidsstmpeln i resultatet.\";'),('sv','messages:apihelp-main-param-errorformat','s:349:\"Format to use for warning and error text output.\n; plaintext: Wikitext with HTML tags removed and entities replaced.\n; wikitext: Unparsed wikitext.\n; html: HTML.\n; raw: Message key and parameters.\n; none: No text output, only the error codes.\n; bc: Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),('sv','messages:apihelp-main-param-errorlang','s:375:\"Sprk att anvnda fr varningar och fel. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> med <kbd>siprop=languages</kbd> returnerar en lista ver sprkkoder eller specifikt <kbd>content</kbd> fr att anvnda innehllssprket p denna wiki, eller specifikt <kbd>uselang</kbd> fr att anvnda samma vrde som parametern <var>uselang</var>.\";'),('sv','messages:apihelp-main-param-errorsuselocal','s:103:\"Om angivet kommer feltexter att anvnda lokalt anpassade meddelande frn namnrymden {{ns:MediaWiki}}.\";'),('sv','messages:apihelp-main-param-format','s:21:\"Formatet fr utdata.\";'),('sv','messages:apihelp-main-param-maxage','s:94:\"Ange headervrdet <code>max-age</code> till s hr mnga sekunder. Fel cachelagras aldrig.\";'),('sv','messages:apihelp-main-param-maxlag','s:488:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),('sv','messages:apihelp-main-param-origin','s:698:\"Nr API:et anvnds genom en cross-domain AJAX-begran (CORS), ange detta till den ursprungliga domnen. Detta mste inkluderas i alla pre-flight-begran, och mpste drfr vara en del av den begrda URI:n (inte i POST-datat). Detta mste verensstmma med en av kllorna i headern <code>Origin</code> exakt, s den mste sttas till ngot i stil med <kbd>http://en.wikipedia.org</kbd> eller <kbd>https://meta.wikimedia.org</kbd>. Om denna parameter inte verensstmmer med headern <code>Origin</code>, returneras ett 403-svar. Om denna parameter verensstmmer med headern <code>Origin</code> och kllan r vitlistad, stts en <code>Access-Control-Allow-Origin</code>-header.\";'),('sv','messages:apihelp-main-param-requestid','s:109:\"Alla vrde som anges hr kommer att inkluderas i svaret. Kan anvndas fr att srskilja frfrgningar.\";'),('sv','messages:apihelp-main-param-responselanginfo','s:96:\"Inkluderar de sprk som anvnds fr <var>uselang</var> och <var>errorlang</var> i resultatet.\";'),('sv','messages:apihelp-main-param-servedby','s:63:\"Inkludera det vrdnamn som besvarade frfrgan i resultatet.\";'),('sv','messages:apihelp-main-param-smaxage','s:95:\"Ange headervrdet <code>s-maxage</code> till s hr mnga sekunder. Fel cachelagras aldrig.\";'),('sv','messages:apihelp-main-param-uselang','s:357:\"Sprk som ska anvndas fr meddelandeversttningar. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> med <kbd>siprop=languages</kbd> returnerar en lista med sprkkoder, eller ange <kbd>user</kbd> fr att anvnda den aktuella anvndarens sprkpreferenser, eller ange <kbd>content</kbd> fr att anvnda innehllssprket.\";'),('sv','messages:apihelp-main-summary','s:0:\"\";'),('sv','messages:apihelp-managetags-example-activate','s:96:\"Aktivera en tagg med namn <kbd>spam</kbd> med anledningen: <kbd>For use in edit patrolling</kbd>\";'),('sv','messages:apihelp-managetags-example-create','s:93:\"Skapa en tagg vid namn <kbd>spam</kbd> med anledningen: <kbd>For use in edit patrolling</kbd>\";'),('sv','messages:apihelp-managetags-example-deactivate','s:90:\"Inaktivera en tagg vid namn <kbd>spam</kbd> med anledningen: <kbd>No longer required</kbd>\";'),('sv','messages:apihelp-managetags-example-delete','s:73:\"Radera <kbd>vandalims</kbd> taggen med andledningen: <kbd>Felstavat</kbd>\";'),('sv','messages:apihelp-managetags-param-ignorewarnings','s:62:\"Om du vill ignorera varningar som utfrdas under operationen.\";'),('sv','messages:apihelp-managetags-param-operation','s:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('sv','messages:apihelp-managetags-param-reason','s:85:\"En icke-obligatorisk orsak fr att skapa, radera, aktivera, eller inaktivera taggen.\";'),('sv','messages:apihelp-managetags-param-tag','s:319:\"Tagg fr att skapa, radera, aktivera eller inaktivera. Vid skapande av tagg kan taggen inte existera. Vid raderande av tagg mste taggen existera. Fr aktiverande av tagg mste taggen existera och inte anvndas i ett tillgg. Fr inaktivering av tagg mste taggen anvndas just nu och vara manuellt definierad.\";'),('sv','messages:apihelp-managetags-param-tags','s:60:\"Change tags to apply to the entry in the tag management log.\";'),('sv','messages:apihelp-managetags-summary','s:65:\"Utfr hanterings uppgifter relaterade till frndrings taggar.\";'),('sv','messages:apihelp-mergehistory-example-merge','s:72:\"Sammanfoga hela historiken fr <kbd>Oldpage</kbd> i <kbd>Newpage</kbd>.\";'),('sv','messages:apihelp-mergehistory-example-merge-timestamp','s:122:\"Sammanfoga den sidversion av <kbd>Oldpage</kbd> daterad fram till <kbd>2015-12-31T04:37: