rymdsprefix.\";'),('sv','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('sv','messages:apihelp-opensearch-param-search','s:12:\"Skstrng.\";'),('sv','messages:apihelp-opensearch-param-suggest','s:127:\"Gr ingenting om <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> r falskt.\";'),('sv','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('sv','messages:apihelp-opensearch-summary','s:38:\"Sk wikin med protokollet OpenSearch.\";'),('sv','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('sv','messages:apihelp-options-example-complex','s:89:\"terstll alla instllningar, stll sedan in <kbd>skin</kbd> och <kbd>nickname</kbd>.\";'),('sv','messages:apihelp-options-example-reset','s:31:\"terstll alla instllningar\";'),('sv','messages:apihelp-options-extended-description','s:183:\"Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('sv','messages:apihelp-options-param-change','s:358:\"List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),('sv','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1opt