VISIONID}}</nowiki></code> and similar variables.\";'),('sv','messages:apihelp-parse-param-section','s:227:\"Only parse the content of this section number.\n\nWhen <kbd>new</kbd>, parse <var>$1text</var> and <var>$1sectiontitle</var> as if adding a new section to the page.\n\n<kbd>new</kbd> is allowed only when specifying <var>text</var>.\";'),('sv','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('sv','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('sv','messages:apihelp-parse-param-summary','s:25:\"Sammanfattning att tolka.\";'),('sv','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('sv','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('sv','messages:apihelp-parse-param-useskin','s:194:\"Apply the selected skin to the parser output. May affect the following properties: <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('sv','messages:apihelp-parse-param-wrapoutputclass','s:43:\"CSS class to use to wrap the parser output.\";'),('sv','messages:apihelp-parse-paramvalue-prop-categories','s:44:\"Gives the categories in the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:33:\"Ger HTML-version av kategorierna.\";'),('sv','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adds the title of the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('sv','messages:apihelp-parse-paramvalue-prop-externallinks','s:48:\"Gives the external links in the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-headhtml','s:141:\"Gives parsed doctype, opening <code>&lt;html&gt;</code>, <code>&lt;head&gt;</code> element and opening <code>&lt;body&gt;</code> of the page.\";'),('sv','messages:apihelp-parse-paramvalue-prop-headitems','s:64:\"Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('sv','messages:apihelp-parse-paramvalue-prop-images','s:40:\"Gives the images in the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-indicators','s:58:\"Gives the HTML of page status indicators used on the page.\";'),('sv','messages:apihelp-parse-paramvalue-prop-iwlinks','s:45:\"Gives interwiki links in the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:110:\"Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),('sv','messages:apihelp-parse-paramvalue-prop-langlinks','s:48:\"Gives the language links in the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('sv','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('sv','messages:apihelp-parse-paramvalue-prop-links','s:48:\"Gives the internal links in the parsed wikitext.\";'),('sv','messages:apihelp-parse-paramvalue-prop-modules','s:211:\"Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('sv','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</co