ent','s:41:\"Adds the parsed comment of the log event.\";'),('sv','messages:apihelp-query+logevents-paramvalue-prop-tags','s:29:\"Lists tags for the log event.\";'),('sv','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:37:\"Adds the timestamp for the log event.\";'),('sv','messages:apihelp-query+logevents-paramvalue-prop-title','s:45:\"Adds the title of the page for the log event.\";'),('sv','messages:apihelp-query+logevents-paramvalue-prop-type','s:27:\"Adds the type of log event.\";'),('sv','messages:apihelp-query+logevents-paramvalue-prop-user','s:44:\"Adds the user responsible for the log event.\";'),('sv','messages:apihelp-query+logevents-paramvalue-prop-userid','s:55:\"Adds the user ID who was responsible for the log event.\";'),('sv','messages:apihelp-query+logevents-summary','s:31:\"Hmta hndelser frn loggar.\";'),('sv','messages:apihelp-query+mystashedfiles-example-simple','s:87:\"Get the filekey, file size, and pixel size of files in the current user\'s upload stash.\";'),('sv','messages:apihelp-query+mystashedfiles-param-limit','s:22:\"How many files to get.\";'),('sv','messages:apihelp-query+mystashedfiles-param-prop','s:40:\"Which properties to fetch for the files.\";'),('sv','messages:apihelp-query+mystashedfiles-paramvalue-prop-size','s:41:\"Fetch the file size and image dimensions.\";'),('sv','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:42:\"Fetch the file\'s MIME type and media type.\";'),('sv','messages:apihelp-query+mystashedfiles-summary','s:55:\"Get a list of files in the current user\'s upload stash.\";'),('sv','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('sv','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('sv','messages:apihelp-query+pagepropnames-summary','s:48:\"List all page property names in use on the wiki.\";'),('sv','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the 