essages:apihelp-query+recentchanges-param-tag','s:39:\"Only list changes tagged with this tag.\";'),('sv','messages:apihelp-query+recentchanges-param-title','s:42:\"Filter entries to those related to a page.\";'),('sv','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('sv','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('sv','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('sv','messages:apihelp-query+recentchanges-param-user','s:31:\"Only list changes by this user.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:53:\"Tags patrollable edits as being autopatrolled or not.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:30:\"Adds the comment for the edit.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:37:\"Adds the parsed comment for the edit.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:65:\"Adds the content checksum for entries associated with a revision.\";'),('sv','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('sv','mes