Om du markerar denna ruta kommer den associerade diskussionssidan att automatiskt flyttas till en ny titel om inte en befintlig diskussionssida redan finns dr.\n\nI detta fall mste du flytta eller sammanfoga sidan manuellt, om det nskas.\";'),('sv','messages:movepagetext','s:1051:\"Med hjlp av formulret hrunder kan du byta namn p en sida, och flytta hela dess historik till ett nytt namn.\nDen gamla sidtiteln kommer att gras om till en omdirigering till den nya titeln.\nDu kan vlja att automatiskt uppdatera omdirigeringar som leder till den gamla titeln.\nOm du vljer att inte gra det, kontrollera d att du inte skapar ngra [[Special:DoubleRedirects|dubbla]] eller [[Special:BrokenRedirects|trasiga omdirigeringar]].\nDu br ocks se till att lnkar fortstter att peka dit de ska.\n\nNotera att sidan <strong>inte</strong> kan flyttas om det redan finns en sida under den nya sidtiteln, svida inte den sidan r en omdirigering till den gamla titeln och saknar annan versionshistorik.\nDet innebr att du kan flytta tillbaks en sida om du rkar gra fel, och att du inte kan skriva ver existerande sidor.\n\n<strong>Observera:</strong>\nAtt flytta en populr sida kan vara en drastisk och ovntad ndring;\ndrfr br du vara sker p att du frstr konsekvenserna innan du fortstter med flytten.\";'),('sv','messages:movepagetext-noredirectfixer','s:890:\"Formulret nedan kommer att byta namn p en sida, och flytta hela sin historik till det nya namnet.\nDen gamla titeln kommer att bli en omdirigeringssida till den nya titeln.\nGlm inte att kontrollera [[Special:DoubleRedirects|dubbla]] eller [[Special:BrokenRedirects|brutna omdirigeringar]].\nDu r ansvarig fr att se till att lnkar fortstter att peka dr de frvntas g.\n\nObservera att sidan <strong>inte</strong> kommer att flyttas om det finns redan en sida p den nya titeln, frutom om den r en omdirigering och saknar tidigare redigeringshistorik.\nDetta innebr att du kan byta tillbaka namnet p en sida om du av misstag bytt namn p den, och du kan inte skriva ver en befintlig sida.\n\n<strong>Observera:</strong>\nDetta kan vara en drastisk och ovntad frndring fr en populr sida;\nse till att du frstr konsekvenserna av detta innan du fortstter.\";'),('sv','messages:movepagetext-noredirectsupport','s:643:\"Nr formulret nedan anvnds byter en sida namn och flyttar all dess historik till det nya namnet.\nDu r ansvarig fr att kontrollera att lnkarna fortstter leda dit dr de ska.\n\nObservera att sidan <strong>inte</strong> kommer att flyttas om det redan finns en sida med den nya titeln.\nDetta innebr att du kan byta tillbaka namnet p en sida till vad den hade innan namnndringen om du gr ett misstag och du kan inte skriva ver en befintlig sida.\n\n<strong>Observera:</strong>\nDetta kan bli en drastisk och ovntad ndring fr en populr sida;\nvar god se till att du frstr konsekvenserna av detta innan du fortstter.\";'),('sv','messages:movereason','s:10:\"Anledning:\";'),('sv','messages:movesubpage','s:34:\"{{PLURAL:$1|Undersida|Undersidor}}\";'),('sv','messages:movesubpagetalktext','s:91:\"Den motsvarande diskussionssidan har $1 {{PLURAL:$1|undersida|undersidor}} som visas nedan.\";'),('sv','messages:movesubpagetext','s:69:\"Denna sida har $1 {{PLURAL:$1|undersida|undersidor}} som visas nedan.\";'),('sv','messages:movetalk','s:35:\"Flytta tillhrande diskussionssida\";'),('sv','messages:movethispage','s:17:\"Flytta denna sida\";'),('sv','messages:moveuserpage-warning','s:155:\"\'\'\'Varning:\'\'\' Du hller p att flytta en anvndarsida. Observera att endast sidan kommer att flyttas och att anvndaren \'\'inte\'\' kommer att byta namn.\";'),('sv','messages:multimediaviewer-about-mmv','s:20:\"Om detta grnssnitt\";'),('sv','messages:multimediaviewer-attr-html','s:4:\"HTML\";'),('sv','messages:multimediaviewer-attr-plain','s:8:\"Klartext\";'),('sv','messages:multimediaviewer-close-popup-text','s:26:\"Stng detta verktyg (Esc)\";'),('sv','messages:multimediaviewer-commons-subtitle','s:21:\"Det fria mediearkivet\";'),('sv','messages:mul